import React, { useState } from 'react';

const Dashboard = () => {
  const [moodScore, setMoodScore] = useState(7.2);
  const [wellnessStreak, setWellnessStreak] = useState(5);
  const [interventions, setInterventions] = useState(3);

  return (
    <div style={{ padding: '40px', textAlign: 'center' }}>
      <h1>Dashboard</h1>
      <p>Your personalized mental wellness overview</p>
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', 
        gap: '20px',
        maxWidth: '800px',
        margin: '30px auto'
      }}>
        <div style={{
          background: 'rgba(255,255,255,0.1)',
          padding: '20px',
          borderRadius: '12px',
          border: '1px solid rgba(255,255,255,0.1)'
        }}>
          <div style={{ fontSize: '2rem', marginBottom: '10px' }}>ðŸ˜Š</div>
          <h3 style={{ margin: '10px 0', color: '#667eea' }}>{moodScore}/10</h3>
          <p style={{ margin: 0, opacity: 0.8 }}>Mood Score</p>
          <button 
            onClick={() => setMoodScore(Math.max(1, Math.min(10, moodScore + (Math.random() - 0.5))))}
            style={{
              background: '#667eea',
              color: 'white',
              border: 'none',
              padding: '5px 10px',
              borderRadius: '4px',
              cursor: 'pointer',
              marginTop: '10px'
            }}
          >
            Update Mood
          </button>
        </div>

        <div style={{
          background: 'rgba(255,255,255,0.1)',
          padding: '20px',
          borderRadius: '12px',
          border: '1px solid rgba(255,255,255,0.1)'
        }}>
          <div style={{ fontSize: '2rem', marginBottom: '10px' }}>ðŸ”¥</div>
          <h3 style={{ margin: '10px 0', color: '#ff6b35' }}>{wellnessStreak} days</h3>
          <p style={{ margin: 0, opacity: 0.8 }}>Wellness Streak</p>
          <p style={{ fontSize: '12px', marginTop: '10px', opacity: 0.7 }}>
            Daily check-ins increase your streak
          </p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
